import React from 'react';
export default function Services(){
  return (
    <section className="page">
      <h2>Our Services</h2>
      <ul>
        <li>Full Lawn Care & Maintenance</li>
        <li>Sod Installation & Yard Restoration</li>
        <li>Home Repairs</li>
        <li>Landscape Design</li>
        <li>Holiday Decoration Installation</li>
      </ul>
    </section>
  );
}
